using System;
using System.Collections;
using System.Collections.Generic;
using System.Text;
using UnityEngine;

public class Demo : MonoBehaviour {

    //public static string Image64 = "";
    public static string Image64 = "";
    // Use this for initialization
    void Start () {
        string url = "https://vision.googleapis.com/v1/images:annotate?key=AIzaSyCz4W-NjIwxZp4N3lhfXnZ09V-JoACy5bE";
        string json = "{\"requests\": [ { \"image\" : {\"content\":\"" + Image64 + "\"},\"features\":[{\"type\":\"LOGO_DETECTION\",\"maxResults\":20}]}]}";
        Dictionary<string, string> headers = new Dictionary<string, string>();
        headers.Add("Content-Type", "application/json");
        
        WWW www = new WWW(url, Encoding.ASCII.GetBytes(json.ToCharArray()), headers);
        StartCoroutine(WaitForRequest(www));
    }

    private IEnumerator WaitForRequest(WWW www)
    {
        yield return www;
        // check for errors
        if (www.error == null)
        {
            Debug.Log("WWW Ok! - result: " + www.text);
        }
        else
        {
            Debug.Log("WWW Error: " + www.error);
        }
    }

    // Update is called once per frame
    void Update () {
		
	}
}
